import React from 'react';
import Button from '../Atoms/Button/Button';
import GameList from '../Components/GameList';
import TeamList from '../Components/TeamList';

function Home() {
    return (
        <div style={{ textAlign: 'center' }}>
            <h1>Welcome to the FNL Hockey Portal!</h1>
            <p>This is your one-stop destination for everything FNL Hockey. Explore games, learn more about teams, and immerse yourself in the thrilling world of FNL Hockey.</p>

            <div style={{ display: 'flex', justifyContent: 'center', marginTop: '50px', gap: '20px' }}>
                <Button title='Explore Games' color='#2196f3' width={'200px'} />
                <Button title='Learn About Teams' color='#2196f3' width={'200px'} />
            </div>

            <h2>Upcoming Games</h2>


            <h2>Featured Teams</h2>


            <p>Don't miss out on the latest FNL Hockey action. Get your tickets now!</p>
        </div>
    );
}

export default Home;
